Verenigde Staten
Actie / Horror
100 minuten

geregisseerd door Peter Winther
met Devon Werkheiser, Justin Deeley en Nicole Forester

Wanneer een meisje vermist raakt in een stad met een verleden van mysterieuze verdwijningen herinneren een stel lokale tieners zich een oude legende over een heks die in de bossen woont en het vlees van kinderen verslindt; de jonge kinderen voor jeugdigheid, de sterke voor kracht en de knappe voor schoonheid. Als uitdaging gaan de tieners naar het huis om de horrorverhalen uit hun jeugd voor eens en altijd uit te bannen. De legende blijkt echter op waarheid te berusten.



